webpackJsonp([73811439464359],{1179:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/fotb-day-zero/index.md absPath of file >>> MarkdownRemark",html:'<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/portfolio-2018/static/fotb0-7f1ff339d13776582a828788ab121440-e8574.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="fotb0"\n        title=""\n        src="/portfolio-2018/static/fotb0-7f1ff339d13776582a828788ab121440-e8574.jpg"\n        srcset="/portfolio-2018/static/fotb0-7f1ff339d13776582a828788ab121440-c94d9.jpg 158w,\n/portfolio-2018/static/fotb0-7f1ff339d13776582a828788ab121440-9885b.jpg 315w,\n/portfolio-2018/static/fotb0-7f1ff339d13776582a828788ab121440-e8574.jpg 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>It\'s coming up to 8pm on Sunday 28th, and that means the Workshops day for <a href="http://www.flashonthebeach.com/">Flash on the Beach 2008</a> is over - but the fun begins again in only another 12 hours, with talks such as <a href="http://www.flashonthebeach.com/sessions/index.php?pageid=2112">"Brilliant Ideas that I\'ve blatantly stolen"</a>, <a href="http://www.flashonthebeach.com/sessions/index.php?pageid=2194">"Mash-up widgets with Adobe AIR"</a> and <a href="http://www.flashonthebeach.com/sessions/index.php?pageid=2186">"Modulating a lot"</a> on the cards for tomorrow.</p>\n<p>The day was good - I attended the <a href="http://www.flashonthebeach.com/sessions/index.php?pageid=2108">"ActionScript 3.0 for Designers"</a> workshop and Mark went along to the <a href="http://www.flashonthebeach.com/sessions/index.php?pageid=2188">"Papervision3D"</a> workshop.  Met new people, like \'Stu\' from <a href="http://www.plagro.com/">Plagro Web Design</a>, recognised others from events like <a href="http://www.flexcamp.co.uk/">FlexCamp London</a> (<a href="http://www.peterelst.com/blog/">Peter Elst</a>), and just recognised some from their blogs (like <a href="http://aralbalkan.com/">Aral Balkan</a>, and <a href="http://www.gskinner.com/blog/">Grant Skinner</a> (at least, I think it was him...))</p>\n<p>Remarkably for a full days\' staring at projection screens I didn\'t end up with a killer headache, but no time to ponder that because it wasn\'t long before we were off to get some food at the <a href="http://www.gbkinfo.com/GBK_Locations.htm">Gourmet Burger Kitchen</a>, shortly followed by a trek over to McDonalds to take full advantage of their free WiFi (because our hotel doesn\'t offer it!).</p>',frontmatter:{title:"FOTB: Day Zero",date:"September 28, 2008",tags:["flash","conferences","flash-on-the-beach","ftob"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/fotb2011-highlight-1/",tags:["flash"],title:"FOTB2011 Highlight #1: HiSlope",image:null,date:"2011-09-15T19:43:55.000Z"}},next:{frontmatter:{path:"/blog/fluid-widths-in-responsive-websites/",tags:["Web Development","Responsive Web Design","CSS","Front End Development"],title:"Fluid widths in responsive websites.",image:"https://cdn-images-1.medium.com/max/1200/1*Key4MifVtUocntQlHnMM9g.jpeg",date:"2018-07-11T11:11:46.274Z"}}}}}});
